h1 {
  text-align: center;
  color: white;
}

label {
  display: block;
  margin-bottom: 10px;
  font-weight: bold;
}

input[type="text"], input[type="email"], input[type="tel"], input[type="password"], input[type="date"] {
  padding: 10px;
  font-size: 16px;
  border: 1px solid #ccc;
  border-radius: 5px;
  margin-bottom: 20px;
  width: 100%;
  box-sizing: border-box;
}

}
input[type="password"] {
  padding: 10px;
  font-size: 16px;
  border: 1px solid #ccc;
  border-radius: 5px;
  margin-bottom: 20px;
  width: 100%;
  box-sizing: border-box;
}


input[type="submit"] {
  padding: 10px;
  font-size: 16px;
  border: none;
  border-radius: 5px;
  margin-bottom: 20px;
  width: 150px;
  box-sizing: border-box;
  cursor: pointer;
  background-color: #4CAF50;
  color: white;
  justify-content: space-between;
  float: right;
}

input[type="submit"]:hover {
  background-color: #45a049;
}

button.next-button, button.back-button{
  padding: 10px;
  font-size: 16px;
  border: none;
  border-radius: 5px;
  margin-bottom: 20px;
  width: 150px;
  box-sizing: border-box;
  cursor: pointer;
  background-color: #4CAF50;
  color: white;
  justify-content: space-between;
}

button.next-button:hover, button.back-button:hover {
  background-color: #3e8e41;
}
button.back-button {
  float: left;
}

button.next-button {
  float: right;
}
	</style>
  </head>
  <body>
    <h1>Sign Up</h1>
    <form>
      <div id="personal-info">
        <label for="name">Name:</label>
        <input type="text" id="name" name="name" required><br><br>
        <label for="email">Email:</label>
        <input type="email" id="email" name="email" required><br><br>
        <button type="button" class="next-button" data-next-section="contact-info">Next</button>
      </div>
      <div id="contact-info" style="display: none;">
        <label for="phone">Phone:</label>
        <input type="tel" id="phone" name="phone" required><br><br>
        <label for="birthdate">Birthday:</label>
        <input type="date" id="birthdate" name="birthdate" required><br><br>
        <button type="button" class="next-button" data-next-section="password">Next</button>
        <button type="button" class="back-button" data-previous-section="personal-info">Back</button>
      </div>
      <div id="password" style="display: none;">
        <label for="password">Password:</label>
        <input type="password" id="password" name="password" required><br><br>
        <label for="confirm-password">Confirm Password:</label>
        <input type="password" id="confirm-password" name="confirm-password" required>
        <button type="button" class="back-button" data-previous-section="contact-info">Back</button>
        <input type="submit" id="submit-button" value="Sign Up">
      </div>
    </form>
    <script>
	const nextButtons = document.querySelectorAll('.next-button');
const backButtons = document.querySelectorAll('.back-button');
const submitButton = document.getElementById('submit-button');

nextButtons.forEach(button => {
  button.addEventListener('click', () => {
    const currentSection = button.parentNode;
    const nextSectionID = button.dataset.nextSection;
    const nextSection = document.getElementById(nextSectionID);

    currentSection.style.display = 'none';
    nextSection.style.display = 'block';
  });
});

backButtons.forEach(button => {
  button.addEventListener('click', () => {
    const currentSection = button.parentNode;
    const previousSectionID = button.dataset.previousSection;
    const previousSection = document.getElementById(previousSectionID);

    currentSection.style.display = 'none';
    previousSection.style.display = 'block';
  });
});

submitButton.addEventListener('click', () => {
  alert('Thanks for signing up!');
});

	</script>
  </body>
</html>
